import React, { Component } from "react";
import axios from "axios";

class PostForm extends Component {
  constructor(props) {
    super(props);
    this.state = {
      espacioID: "",
    };
  }
 clickMe() {
    alert("You clicked me!");
  }

  changeHandler = (e) => {
    this.setState({ [e.target.name]: e.target.value });
  };

  submitHandler = (e) => {
    e.preventDefault();
    console.log(this.state);
  };

  render() {
    const { espacioID } = this.state;
    return (
      <>
        <div>
          <h1>Consultar Espacios Disponibles</h1>
          <button onClick={this.clickMe}>Consultar</button>
        </div>
        <div>
          <h1>Consultar Espacios Ocupados</h1>
          <button onClick={this.clickMe}>Consultar</button>
        </div>
        <div>
          <h1>Reservar Espacio</h1>
          <button onClick={this.clickMe}>Reservar</button>
        </div>
        <div>
          <h1>Liberar Espacios</h1>
          <div>
            <div>
              <form onSubmit={this.submitHandler}>
                <h3>Ingrese el ID del espacio</h3>

                <input
                  type="number"
                  name="espacioID"
                  value={espacioID}
                  onChange={this.changeHandler}
                />
                <button type="submit">Liberar</button>
              </form>
            </div>
          </div>
        </div>
      </>
    );
  }
}

export default PostForm;
